	function loadPredefinedScriptOld(scriptName)
	{
		var scriptSrc=getScriptSrcByName(scriptName);
		var scriptToLoad='<script type="text/javascript" src="'+scriptSrc+'"><\/script>';
		document.write(scriptToLoad);
	};
	
	function loadPredefinedScript(scriptName)
	{
		var scriptSrc=getScriptSrcByName(scriptName);
		scriptAppender(scriptName,scriptSrc);
	};
	
