	function loadPredefinedScripts(scriptsArray)
	{
		for(count=0;count<scriptsArray.length;count++)
		{
			var src=getScriptSrcByName(scriptsArray[count]);
			//alert(link);
			scriptAppender(scriptsArray[count],src);
		}
	};
	function loadPredefinedStyles(stylesArray)
	{
		for(count=0;count<stylesArray.length;count++)
		{
			if(stylesArray[count] !="")
			{
				var link=getStyleByName(stylesArray[count]);
				//alert(link);
				styleSheetAppender(stylesArray[count],link);
			}
		}
	};

	function loadAllScriptsNStylesOld()
	{
		for(count=0;count<preDefinedScripts.length;count++)
		{
			var scriptSrc='<script type="text/javascript" src="'+preDefinedScripts[count].src+'"><\/script>';
			document.write(scriptSrc);
		}
		for(count=0;count<preDefinedStyles.length;count++)
		{
			document.write('<link rel="stylesheet" type="text/css" href="'+preDefinedStyles[count].link+'" />');
		}
	};
	
	function loadAllScriptsNStyles()
	{
		for(count=0;count<preDefinedScripts.length;count++)
		{
			//var scriptSrc='<script type="text/javascript" src="'+preDefinedScripts[count].src+'"><\/script>';
			//document.write(scriptSrc);
			scriptAppender(preDefinedScripts[count].name,preDefinedScripts[count].src);
		}
		for(count=0;count<preDefinedStyles.length;count++)
		{
			//document.write('<link rel="stylesheet" type="text/css" href="'+preDefinedStyles[count].link+'" />');
			styleAppender(preDefinedStyles[count].name,preDefinedStyles[count].link);
		}
	};
	
	function loadAllDashboardScriptsNStyles()
	{
		
		for(count=0;count<preDefinedScripts.length;count++)
		{
			if ((preDefinedScripts[count].name.toLowerCase().indexOf("db") >= 0)||(preDefinedScripts[count].name.toLowerCase().indexOf("bootstrap") >= 0))
			{
				var scriptSrc='<script type="text/javascript" src="'+preDefinedScripts[count].src+'"><\/script>';
				document.write(scriptSrc);
				//alert(preDefinedScripts[count].name);
			}
		}
		for(count=0;count<preDefinedStyles.length;count++)
		{
			if ((preDefinedStyles[count].name.toLowerCase().indexOf("db") >= 0)||(preDefinedStyles[count].name.toLowerCase().indexOf("bootstrap") >= 0))
			{
				document.write('<link rel="stylesheet" type="text/css" href="'+preDefinedStyles[count].link+'" />');
			}
		}
		
	};
	
	function getScriptSrcByName(scriptName)
	{
		var result = preDefinedScripts.filter(function(thisScript) 
		{
			return thisScript.name === scriptName;
		});
		return result[0].src;
	};
	
	function getStyleByName(styleName)
	{
		//alert(styleName);
		var result = preDefinedStyles.filter(function(thisStyle) 
		{
			return thisStyle.name === styleName;
		});
		console.log(result);
		return result[0].link;
	};
	
