	function convertToExapandable(columnName,columnText,longestTextLength)
	{
		var firsthalf="",secondhalf="",returnText="";
		for (var count = 0; count < columnText.length; count += longestTextLength) 
			{
				if(count == 0)
				{
					firsthalf= columnText.substring(count, count + longestTextLength);
				}
				else
				{
					secondhalf+= columnText.substring(count, count + longestTextLength);
				}
			}
			console.log("firsthalf:"+firsthalf+";   Second half: "+secondhalf);
			if(secondhalf != "")
			{
				returnText= firsthalf+'<span class="'+columnName+'_truncated">'+secondhalf+'</span>';
			}
			else
			{
				returnText= firsthalf;
			}	

			
		return returnText;
	};

