	function styleSheetAppender(cssId,cssHref)
	{
	    cssId = "SJAPI_" + cssId;
		if (!document.getElementById(cssId))
		{
			var head  = document.getElementsByTagName('head')[0];
			var link  = document.createElement('link');
			link.id   = cssId;
			link.rel  = 'stylesheet';
			link.type = 'text/css';
			link.href = cssHref;
			link.media = 'all';
			head.appendChild(link);
		}
	};
	
	function scriptAppender(scriptId,scriptSrc)
	{
		scriptId="SJAPI_"+scriptId;
		if (!document.getElementById(scriptId))
		{
			var head  = document.getElementsByTagName('head')[0];
			var scriptContent  = document.createElement('script');
			scriptContent.id   = scriptId;
			scriptContent.type = 'text/javascript';
			scriptContent.src = scriptSrc;
			head.appendChild(scriptContent);
		}
	};

	function styleAppender(cssId, chartStyle) {
	    cssId = "SJAPI_" + cssId;
	    if (!document.getElementById(cssId)) {
	        var head = document.getElementsByTagName('head')[0];
	        var style = document.createElement('style');
	        style.id = cssId;
	        style.type = 'text/css';
	        /*if (style.styleSheet) {
	            style.styleSheet.cssText = chartStyle;
	        } else {*/
	        style.appendChild(document.createTextNode(chartStyle));
	        //}
	        // head.appendChild(style);
	        head.appendChild(style);
	        // document.write('<style>'+style+'</style>');
	    }
	    //document.write('<style>'+chartStyle+'</style>');
	};
	
